import { useState } from "react";
import React from "react";
import axios from "axios";
import HeaderLinks from "./HeaderLinks.js";
import Transfer from "./Transfer.js";
import DatePicker from "react-datepicker";
import "react-datepicker/dist/react-datepicker.css";

function Header() {
  return (
    <div className="header-wrapper">
      <h1>Transactions</h1>
      <HeaderLinks />
    </div>
  );
}

function ManageWells(toToggle) {
  if (toToggle != "ManageGroups")
    document.getElementById("ManageGroups").classList.add("is-hidden");

  if (toToggle != "AddEnvelope")
    document.getElementById("AddEnvelope").classList.add("is-hidden");

  if (toToggle != "Transfer")
    document.getElementById("Transfer").classList.add("is-hidden");

  let e = document.getElementById(toToggle);
  if (e.classList.contains("is-hidden")) e.classList.remove("is-hidden");
  else e.classList.add("is-hidden");
}

function Subheader() {
  const handleImport = () => {
    ManageWells("Import");
  };
  const handleUncat = () => {
    ManageWells("Uncategorized");
  };
  const handleDuplicates = () => {
    ManageWells("Duplicates");
  };
  const handleFilters = () => {
    ManageWells("Filters");
  };
  const handleTransfer = () => {
    ManageWells("Transfer");
  };

  return (
    <div key="Subheader-Wrapper" className="subheader-wrapper">
      <div key="Subheader-Buttons" className="subheader-buttons">
        <button key="Subheader-Groups" onClick={handleImport}>
          import
        </button>
        &nbsp;&nbsp;
        <button key="Subheader-AddEnvelope" onClick={handleUncat}>
          uncatagorized
        </button>
        &nbsp;&nbsp;
        <button key="Subheader-Transfer" onClick={handleDuplicates}>
          duplicates
        </button>
        &nbsp;&nbsp;
        <button key="Subheader-Transfer" onClick={handleFilters}>
          filters
        </button>
        &nbsp;&nbsp;
        <button key="Subheader-Transfer" onClick={handleTransfer}>
          transfer
        </button>
        &nbsp;&nbsp;
      </div>
      <div key="Subheader-SubItems" className="subItems">
        <Transfer />
      </div>
    </div>
  );
}

export default function Budget() {
  return (
    <>
      <Header />
      <Subheader />
      "hello world"
    </>
  );
}
